import React, { useState } from 'react';


const Input = () => {
  const [value, setValue] = useState('');


 

  return (
    <div>
      <input
        type="text"
        value={value}
        onChange={(event) => setValue(event.target.value)}
      />
      <button>Submit</button>
      <p>{value}</p>
    </div>
  );
};

export default Input;
